const Book = ((book)=>{

    return (
        <>
            <div className="list">
                <div className="book">
                    {book.cover && <img src = {book.cover} alt ="/"/>}
                    <h2>{book.title}</h2>
                    <h3>{book.desc}</h3>
                </div>
            </div>
        </>
    )
})
export default Book
